export default {
  name: 'FlowEditor',
  data: function data() {
    return {
      baseUrl: ''
    };
  },
  props: {
    /**
     * 可通过processId+businessKey
     * 或者processInstanceId
     * 或者 processInstanceId+processDefinitionId
     * 进行流程图查看
     */
    modelId: {
      type: String,
      default: '',
      required: false
    },
    height: {
      type: String,
      default: null
    }
  },
  mounted: function mounted() {
    this.baseUrl = process.env.NODE_ENV === 'production' ? process.env.VUE_APP_BASE_API : '/api'; // api 的 base_url

    /**
     * iframe-宽高自适应显示
     */

    var oIframe = document.getElementById('FlowEditor');
    var deviceWidth = document.documentElement.clientWidth;
    var deviceHeight = document.documentElement.clientHeight;
    oIframe.style.width = Number(deviceWidth) + 'px'; // 数字是页面布局宽度差值

    if (this.height) {
      oIframe.style.height = this.height;
    } else {
      oIframe.style.height = '100vh'; //(Number(deviceHeight) - 300) + 'px'
    }
  }
};
